import React from 'react'

export const Question_many = (props) =>{
        const type = "many";
        const i = 0;
        return(
            <div className = "question_one_text">
                <h1>{props.q_text}</h1>
                <p><input name={'many'+props.uid+i} type="checkbox" value="nedzen"/> Ответ1</p>
                <p><input name={'many'+props.uid+i} type="checkbox" value="dzen"/> Ответ2</p>
                <p><input name={'many'+props.uid+i} type="checkbox" value="pdzen"/> Ответ3</p>

                <h1>{""+props.q_text}</h1>
                {
                    props.ans.map((answers) => {
                        return(
                            <p><input name={"many_answer_"+props.uid} type="checkbox" value={answers}/>{answers}</p>
                        );
                    })
                }
            </div>
        )
}
